import About from './components/About';
import Home from './components/sections/Home';

function App() {
  return (
    <>
    <BrowserRouter>
    <Home />
      <Routes>
        {/* <Route path="/" element={<Home />}>
        <Route index element={<Home />} />
        <Route path='/about' element={<About/>} />
        </Route> */}
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
